    if(!isLoaded)
    return <h2>Is Loading...</h2>

  return (

    // <div className="navBody flexSB" >
    <GoogleMap zoom={10} center={{lat:44,lng:-80}} mapContainerClassName="map"/>
    // </div>
  )
}

export default Map
